// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;
import "./IotaHeroUtil.sol";
import "./IotaHeroGameTokens.sol";

contract IotaHeroAdventure is IotaHeroUtil {
    IotaHeroGameTokens public tokens;
    using SafeMath for uint256;
    uint256 randomNonce = 0;
    uint256 adventureCounter = 0;

    mapping(uint256 => uint256) adventureToHero;
    mapping(uint256 => bool) heroIsAdventuring;
    mapping(uint256 => bool) adventureToCompleted;

    modifier correctHeroForAdventure(uint256 _heroId, uint256 _adventureId) {
        require(
            adventureToHero[_adventureId] == _heroId,
            "This hero is not on this adventure"
        );
        _;
    }
    modifier adventureNotCompleted(uint256 _adventureId) {
        require(
            adventureToCompleted[_adventureId] == false,
            "Adventure already completed"
        );
        _;
    }

    function setTokens(address tokensAddress) public onlyOwner {
        tokens = IotaHeroGameTokens(tokensAddress);
    }

    function getTokenAddress() public view returns (address) {
        return address(tokens);
    }

    event AdventureInitiated(
        address player,
        uint256 heroId,
        uint256 adventureId
    );

    event AdventureCompleted(
        address indexed player,
        uint256 indexed heroId,
        uint256 adventureId
    );

    function completeAdventure(
        address _player,
        uint256 _heroId,
        uint256 adventureId,
        uint256[] calldata lootTokenIds,
        uint256[] calldata lootAmounts
    )
        external
        onlyOwner
        adventureNotCompleted(adventureId)
        correctHeroForAdventure(_heroId, adventureId)
    {
        adventureToCompleted[adventureId] = true;
        heroIsAdventuring[_heroId] = false;
        tokens.awardAdventurer(msg.sender, lootTokenIds, lootAmounts);
        emit AdventureCompleted(_player, _heroId, adventureId);
    }

    function isHeroAdventuring(uint256 _heroId) public view returns (bool) {
        return heroIsAdventuring[_heroId];
    }

    function isAdventureCompleted(uint256 _adventureId)
        public
        view
        returns (bool)
    {
        return adventureToCompleted[_adventureId];
    }

    function goAdventure(uint256 _heroId)
        external
        hasAccount
        onlyOwnerOf(_heroId)
    {
        Hero storage myHero = heroes[_heroId];
        require(
            heroIsReady(myHero),
            "Hero is not ready to go a new adventure yet.."
        );
        myHero.restingTill = uint32(block.timestamp + adventureCoolDown);
        adventureCounter++;
        adventureToHero[adventureCounter] = _heroId;
        adventureToCompleted[adventureCounter] = false;
        heroIsAdventuring[_heroId] = true;
        emit AdventureInitiated(msg.sender, _heroId, adventureCounter);

        // uint256 rand = _pseudoRandom(randomNonce) % 100;
        // uint256 rand2 = _pseudoRandom(rand);
        // Adventure storage adv = adventures[rand2 % adventures.length];
        // if (adv.adventureType == AdventureType.MONSTER) {
        //     if (rand < 50) {
        //         myHero.xp = myHero.xp.add(100);
        //         tokens.awardAdventurer(msg.sender);
        //     } else {
        //         myHero.xp = myHero.xp.div(2);
        //     }
        // } else if (adv.adventureType == AdventureType.FRIENDLY) {
        //     tokens.awardAdventurer(msg.sender);
        // } else if (adv.adventureType == AdventureType.ENVIRONMENT) {
        //     if (rand < 50) {
        //         myHero.physical = myHero.physical.add(1);
        //     } else {
        //         myHero.physical = myHero.physical.sub(1);
        //     }
        // } else if (adv.adventureType == AdventureType.EMPTY) {
        //     // do nothing
        // } else if (adv.adventureType == AdventureType.MENTAL_TRAINING) {
        //     if (rand < 50) {
        //         myHero.mental = myHero.mental.add(1);
        //     }
        // } else if (adv.adventureType == AdventureType.PHYSICAL_TRAINING) {
        //     if (rand < 50) {
        //         myHero.physical = myHero.physical.add(1);
        //     }
        // }
        // myHero.debug = rand;
        // myHero.restingTill = uint32(block.timestamp + adventureCoolDown);
        // randomNonce = randomNonce.add(1);
    }
}
